import React from 'react'

const Spotify = () => {
  return (
    <div name="spotify" className='w-full h-screen pt-[60px] bg-[#F3E5FA]'>
      <div className='max-w-[1100px] mx-auto px-8 flex flex-col justify-center h-full md:flex-row md:items-center'>
        <h1>Here is info about my Spotify Project</h1>
      </div>
    </div>
  )
}

export default Spotify
